    null,nt"notes": "GeoSam is Iowau2019s geologic site and sample tracking program.
      The information available in Geosam can be used by drillers, consultants, engineers,
    property owners, and the general public to aid in estimating the depth to major
    geologic features, well depth and construction concepts, water yield of specific
    aquifers and other site specific information needs.  GeoSam provides location, identification,
    and other key information about every available well, rock exposure, or site of
